import { Component } from '@angular/core';
import { NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { EventManager } from 'app/core/util/event-manager.service';

@Component({
  selector: 'ic-job-execution-exit-message-dialog',
  templateUrl: './job-execution-exit-message-dialog.component.html',
})
export class JobExecutionExitMessageDialogComponent{
  exitMessage?: string;

  constructor(public activeModal: NgbActiveModal, protected eventManager: EventManager) {}


  cancel(): void {
    this.activeModal.dismiss();
  }
}
<form name="runAdhocForm">
  <div class="modal-header">
    <h4 class="modal-title" icTranslate="jobWebApp.jobExecution.btn.viewExitMessage">View Exit Message</h4>
    <button type="button" class="close" data-dismiss="modal" aria-hidden="true" (click)="cancel()">&times;</button>
  </div>

  <div class="modal-body">
    <div class="container-fluid">
      <div class="row" style="overflow-x: auto;">
        <span>{{exitMessage}}</span>
      </div>
    </div>
  </div>

  <div class="modal-footer">
    <button type="button" class="btn btn-secondary btn-sm" data-dismiss="modal" (click)="cancel()">
      <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="entity.action.cancel">Cancel</span>
    </button>
  </div>
</form>
